ng":{"width":720,"height":480}}}],"execution_count":35},{"cell_type":"code","source":"data$datetime <- as.POSIXct(sprintf(\"%04d-%02d-%02d %02d:00:00\",\n                                    data$year, data$month, data$day, data$hour),\n                            format = \"%Y-%m-%d %H:%M:%S\")","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T06:12:38.276098Z","iopub.execute_input":"2025-05-21T06:12:38.277654Z","iopub.status.idle":"2025-05-21T06:12:38.381513Z","shell.execute_reply":"2025-05-21T06:12:38.379551Z"}},"outputs":[],"execution_count":36},{"cell_type":"code","source":"Eksik gözlemleri mevsimsellik temelinde zaman serisi üzerinde analiz etmek, \neksik verilerin belirli mevsimlerde (ilkbahar, yaz, sonbahar, kış) \nsistematik bir şekilde tekrar edip etmediğini anlamak açısından oldukça değerlidir.","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"markdown","source":"Mevsimleri oluşturma","metadata":{}},{"cell_type":"code","source":"data <- data %>%\n  mutate(\n    month = as.numeric(format(datetime, \"%m\")),\n    hour = as.numeric(format(datetime, \"%H\")),\n    season = case_when(\n      month %in% c(12, 1, 2)  ~ \"Kış\",\n      month %in% c(3, 4, 5)   ~ \"İlkbahar\",\n      month %in% c(6, 7, 8)   ~ \"Yaz\",\n      month %in% c(9, 10, 11) ~ \"Sonbahar\"\n    )\n  )","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T06:12:45.596587Z","iopub.execute_input":"2025-05-21T06:12:45.598268Z","iopub.status.idle":"2025-05-21T06:12:45.659603Z","shell.execute_reply":"2025-05-21T06:12:45.657764Z"}},"outputs":[],"execution_count":37},{"cell_type":"code","source":"# Eksik veri sütunları\neksik_sezon <- data %>%\n  mutate(\n    across(c(pm10, so2, no2, o3, prcp, wdir, pres), ~ is.na(.), .names = \"na_{.col}\")\n  ) %>%\n  group_by(season) %>%\n  summarise(across(starts_with(\"na_\"), sum, .names = \"sum_{.col}\"), .groups = \"drop\") %>%\n  pivot_longer(cols = starts_with(\"sum_\"), names_to = \"De