Eksik verileri mice() ile tamamla\nimp_all <- mice(veri_mice, m = 1, method = \"norm.predict\", seed = 42)\n\n##### Tamamlanan verileri ana veri setine aktar\n\ntamamlanan <- complete(imp_all)\n\ndata$pm10_imputed <- tamamlanan$pm10\ndata$so2_imputed  <- tamamlanan$so2\ndata$no2_imputed  <- tamamlanan$no2\ndata$o3_imputed   <- tamamlanan$o3\ndata$prcp_imputed <- tamamlanan$prcp\ndata$wdir_imputed <- tamamlanan$wdir\ndata$pres_imputed <- tamamlanan$pres","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T06:29:02.311579Z","iopub.execute_input":"2025-05-21T06:29:02.313594Z","iopub.status.idle":"2025-05-21T06:29:06.528537Z","shell.execute_reply":"2025-05-21T06:29:06.525230Z"}},"outputs":[{"name":"stdout","text":"\n iter imp variable\n  1   1  pm10  so2  no2  o3  prcp  wdir  pres\n  2   1  pm10  so2  no2  o3  prcp  wdir  pres\n  3   1  pm10  so2  no2  o3  prcp  wdir  pres\n  4   1  pm10  so2  no2  o3  prcp  wdir  pres\n  5   1  pm10  so2  no2  o3  prcp  wdir  pres\n","output_type":"stream"}],"execution_count":49},{"cell_type":"markdown","source":"# #  Yeni veri setini \"data_r\" olarak tanımlanması  # ","metadata":{}},{"cell_type":"code","source":"# Yeni veri setini tanımla\ndata_r <- data %>%\n  transmute(\n    datetime = datetime,  # zaman bilgisi\n    year = year,\n    month = month,\n    day = day,\n    hour = hour,\n    season = season,\n    \n    # MICE ile tamamlanmış değişkenler\n    pm10 = pm10_imputed,\n    so2 = so2_imputed,\n    no2 = no2_imputed,\n    o3 = o3_imputed,\n    prcp = prcp_imputed,\n    wdir = wdir_imputed,\n    pres = pres_imputed,\n    \n    # Eksiksiz olan diğer değişkenler (örn: meteoroloji)\n    temp = temp,\n    rhum = rhum,\n    wspd = wspd\n  )\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T06:15:41.051286Z","iopub.execute_input":"2025-05-21T06:15:41.052908Z","iopub.status.idle":"2025-05-21T06:15:41.072045Z","shell.execute_reply":"2025-05-21T06:15:41.070249Z"}},"outputs":[],"execution_coun