n          rhum_z   rhum_z_outlier           wspd_z   wspd_z_outlier \n            TRUE            FALSE             TRUE            FALSE \npm10_iqr_outlier  so2_iqr_outlier  no2_iqr_outlier   o3_iqr_outlier \n           FALSE            FALSE            FALSE            FALSE \ntemp_iqr_outlier rhum_iqr_outlier prcp_iqr_outlier wdir_iqr_outlier \n           FALSE            FALSE            FALSE            FALSE \nwspd_iqr_outlier pres_iqr_outlier \n           FALSE            FALSE "},"metadata":{}}],"execution_count":50},{"cell_type":"markdown","source":"# **Aykırı Deger Analizi** \n# # - z score","metadata":{}},{"cell_type":"code","source":"\n# Tüm sayısal sütunları seç\nsayisal_deg <- data_r %>% select(where(is.numeric)) %>% names()\n\n# Z-score hesapla ve aykırıları işaretle\nfor (var in sayisal_deg) {\n  data_r[[paste0(var, \"_z\")]] <- scale(data_r[[var]])\n  data_r[[paste0(var, \"_z_outlier\")]] <- abs(data_r[[paste0(var, \"_z\")]]) > 3\n}\n\n# Z-score tabanlı aykırı özet: \nzscore_ozet <- data.frame(\n  Degisken = gsub(\"_z_outlier\", \"\", grep(\"_z_outlier$\", names(data_r), value = TRUE)),\n  Aykiri_Sayi = sapply(grep(\"_z_outlier$\", names(data_r), value = TRUE),\n                       function(col) sum(data_r[[col]], na.rm = TRUE)),\n  Toplam = nrow(data_r)\n) %>%\n  mutate(Aykiri_Yuzde = round(100 * Aykiri_Sayi / Toplam, 2)) %>%\n  filter(Aykiri_Sayi > 0)  # 🔍 0 olanları çıkar","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T06:16:43.697190Z","iopub.execute_input":"2025-05-21T06:16:43.698822Z","iopub.status.idle":"2025-05-21T06:16:43.776308Z","shell.execute_reply":"2025-05-21T06:16:43.774076Z"}},"outputs":[],"execution_count":45},{"cell_type":"code","source":"# Barplot\n# Yükseklik ve genişlik ayarı (örneğin: 12 x 8 inç)\noptions(repr.plot.width = 12, repr.plot.height = 8)\nggplot(zscore_ozet, aes(x = reorder(Degisken, Aykiri_Yuzde), y = Aykiri_Yuzde)) +\n  geom_col(fill = \"tomato\") +\n  geom_text(aes(label = paste0(Aykir