cerli_degiskenler, \"_iqr_outlier\")\n\niqr_ozet <- data.frame(\n  Degisken = gecerli_degiskenler,\n  Aykiri_Sayi = sapply(iqr_cols, function(col) sum(data_r[[col]], na.rm = TRUE)),\n  Toplam = nrow(data_r)\n) %>%\n  mutate(Aykiri_Yuzde = round(100 * Aykiri_Sayi / Toplam, 2)) %>%\n  filter(Aykiri_Sayi > 0)","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T06:18:25.260405Z","iopub.execute_input":"2025-05-21T06:18:25.262243Z","iopub.status.idle":"2025-05-21T06:18:25.342567Z","shell.execute_reply":"2025-05-21T06:18:25.340626Z"}},"outputs":[{"name":"stdout","text":" [1] \"pm10\" \"so2\"  \"no2\"  \"o3\"   \"temp\" \"rhum\" \"prcp\" \"wdir\" \"wspd\" \"pres\"\n","output_type":"stream"}],"execution_count":47},{"cell_type":"code","source":"# Yükseklik ve genişlik ayarı (örneğin: 12 x 8 inç)\noptions(repr.plot.width = 12, repr.plot.height = 8)\nggplot(iqr_ozet, aes(x = reorder(Degisken, Aykiri_Yuzde), y = Aykiri_Yuzde)) +\n  geom_col(fill = \"darkred\") +\n  geom_text(aes(label = paste0(Aykiri_Sayi, \" gözlem\")),\n            hjust = -0.1, size = 4) +\n  coord_flip() +\n  labs(title = \"IQR Yöntemi ile Aykırı Değer Oranları (Mevcut Değişkenler)\",\n       x = \"Değişken\", y = \"Aykırı (%)\") +\n  theme_minimal()","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T06:18:34.512639Z","iopub.execute_input":"2025-05-21T06:18:34.514746Z","iopub.status.idle":"2025-05-21T06:18:34.889399Z","shell.execute_reply":"2025-05-21T06:18:34.884815Z"}},"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABaAAAAPACAIAAABM5kn/AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2AURR/H8f9eSe8JCRBqQm/SpQgiqFTpKCAd6cqDghQVAUGKUgSpogiKiIj0\noiiCIqAIiChFpDfp6fXKPi8uhCO5JJcQCBu+n1fc7Ozs7O3s5vbHFkVVVQEAAAAAANAyXV53\nAAAAAAAA4F4RcAAAAAAAAM0j4AAAAAAAAJpHwAEAAAAAADSPgAMAAAAAAGgeAQcAAAAAANA8\nAg4AAAAAAKB5BBwAAAAAAEDzHrmAY3JJP0VRWv12Ne0E1fzTl/P6dXqmdIlQH3cX38CC5as1\nHPzGe3vPx6VvpKKni5KOTmfw9itQrUGLSR9vs2bahxNL2iqKotO7fXnJQeMiopojmwS4K4pS