 iqr_outlier_cols[sapply(iqr_outlier_cols, function(col) {\n  sum(data_r[[col]], na.rm = TRUE) > 0\n})]\n\n# Aylık aykırı sayısını hesapla\niqr_aylik_ozet <- lapply(iqr_outlier_cols_aktif, function(col) {\n  degisken_adi <- gsub(\"_iqr_outlier\", \"\", col)\n  data_r %>%\n    mutate(month = factor(month, levels = 1:12, labels = month.abb)) %>%\n    group_by(month) %>%\n    summarise(Aykiri_Sayi = sum(.data[[col]], na.rm = TRUE), .groups = \"drop\") %>%\n    mutate(Degisken = degisken_adi)\n}) %>%\n  bind_rows()\n# Yükseklik ve genişlik ayarı (örneğin: 12 x 8 inç)\noptions(repr.plot.width = 12, repr.plot.height = 8)\n\nggplot(iqr_aylik_ozet, aes(x = month, y = Aykiri_Sayi, fill = Degisken)) +\n  geom_col(show.legend = FALSE) +\n  facet_wrap(~Degisken, scales = \"free_y\") +\n  labs(title = \"IQR Yöntemiyle Aykırı Değerlerin Aylık Dağılımı (Z-Score Hariç)\",\n       x = \"Ay\", y = \"Aykırı Gözlem Sayısı\") +\n  theme_minimal()","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-20T08:46:23.935158Z","iopub.execute_input":"2025-05-20T08:46:23.936787Z","iopub.status.idle":"2025-05-20T08:46:25.248155Z","shell.execute_reply":"2025-05-20T08:46:25.245455Z"}},"outputs":[],"execution_count":null},{"cell_type":"markdown","source":"# **AQI HESAPLAMA**","metadata":{}},{"cell_type":"markdown","source":"Türkiye Ulusal Hava Kalitesi İndeksi’ni oluştururken, US-EPA Hava Kalitesi İndeksi’ni ulusal mevzuat ve sınır değerleriyle uyumlu hale getirmiştir.\n\nİndeksi belirleyen hava kirletici maddeler,\n\npartikül madde (PM10), (24 saatlik ortalama)\n\nkarbon monoksit (CO), (8 saatlik ortalama)(Bandırma verileri bulunamadı)\n\nazot dioksit (NO2), (1 saatlik ortalama)\n\nkükürt dioksit (SO2) (1 saatlik ortalama)\n\nozon (O3)(8 saatlik ortalama) \n\n-PM2.5 için sınır değerinin henüz bulunmamasıdır.\n\nSöz parametreler www.havaizleme.gov.tr adresinden anlık olarak takip edilebilmektedir","metadata":{}},{"cell_type":"markdown","source":"# # # Ulusal Türkiye HKİ Kesme Noktalarının Tanımlanması","metadata":{}},{"cell_type":"markdown","source":"![image.png](attachment:152d5c6d-5f1c-4423-a67c-65bcea9da89b.png)![image.png]","metadata":{},"attachments":{"152d5c6d-5f1c-4423-a67c-65bcea9da89b.png":{"image/png":""},"08bf51ef-ee7c-4250-86c9-e7c122fc7241.png":{"image/png":""}}},{"cell_type":"code","source":"# Türkiye Ulusal HKİ Kesme Noktaları\nhki_araliklari <- list(\n  pm10 = data.frame(\n    I_lo = c(0, 51, 101, 151, 201, 301),\n    I_hi = c(50, 100, 150, 200, 300, 500),\n    BP_lo = c(0, 51, 101, 151, 201, 301),\n    BP_hi = c(50, 100, 150, 200, 300, 500)\n  ),\n  so2 = data.frame(\n    I_lo = c(0, 51, 101, 151, 201, 301),\n    I_hi = c(50, 100, 150, 200, 300, 500),\n    BP_lo = c(0, 51, 101, 151, 201, 301),\n    BP_hi = c(50, 100, 150, 200, 300, 500)\n  ),\n  no2 = data.frame(\n    I_lo = c(0, 51, 101, 151, 201, 301),\n    I_hi = c(50, 100, 150, 200, 300, 500),\n    BP_lo = c(0, 101, 201, 400, 800, 1600),\n    BP_hi = c(100, 200, 399, 799, 1599, 2000)\n  ),\n  o3 = data.frame(\n    I_lo = c(0, 51, 101, 151, 201, 301),\n    I_hi = c(50, 100, 150, 200, 300, 500),\n    BP_lo = c(0, 121, 181, 241, 401, 801),\n    BP_hi = c(120, 180, 240, 400, 800, 1000)\n  )\n)","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T06:41:13.509622Z","iopub.execute_input":"2025-05-21T06:41:13.511428Z","iopub.status.idle":"2025-05-21T06:41:13.526778Z","shell.execute_reply":"2025-05-21T06:41:13.524960Z"}},"outputs":[],"execution_count":51},{"cell_type":"markdown","source":"# # # Formül#","metadata":{}},{"cell_type":"markdown","source":"![image.png](attachment:99dab227-ed81-481a-a7ef-04ab72a81035.png)![image.png]","metadata":{},"attachments":{"99dab227-ed81-481a-a7ef-04ab72a81035.png":{"image/png":""},"d2cf4729-c588-4a8c-8e28-3d1b65f64a84.png":{"image/png":""}}},{"cell_type":"code","source":"# HKİ Hesaplama Fonksiyonu\n\nhesapla_hki <- function(c, pollutant) {\n  if (is.na(c)) return(NA)  # Eksik gözlemler için\n  aralik <- hki_araliklari[[pollutant]]\n  for (i in 1:nrow(aralik)) {\n    if (c >= aralik$BP_lo[i] && c <= aralik$BP_hi[i]) {\n      return(\n        (aralik$I_hi[i] - aralik$I_lo[i]) / (aralik$BP_hi[i] - aralik$BP_lo[i]) *\n          (c - aralik$BP_lo[i]) + aralik$I_lo[i]\n      )\n    }\n  }\n  return(NA)  # Eğer hiçbir aralığa girmiyorsa\n}\n\n#  Ortalama Süreler ve HKİ Sütunlarının Oluşturulması\n\nlibrary(dplyr)\nlibrary(zoo)  # rollmean fonksiyonu için\n\ndata_hki <- data_r %>%\n  arrange(datetime) %>%\n  mutate(\n    pm10_avg = zoo::rollmean(pm10, k = 24, fill = NA, align = \"right\"),\n    o3_avg   = zoo::rollmean(o3,   k = 8,  fill = NA, align = \"right\"),\n    so2_avg  = so2,\n    no2_avg  = no2\n  ) %>%\n  rowwise() %>%\n  mutate(\n    pm10_AQI = hesapla_hki(pm10_avg, \"pm10\"),\n    o3_AQI   = hesapla_hki(o3_avg, \"o3\"),\n    so2_AQI  = hesapla_hki(so2_avg, \"so2\"),\n    no2_AQI  = hesapla_hki(no2_avg, \"no2\"),\n    gen_AQI  = max(c(pm10_AQI, o3_AQI, so2_AQI, no2_AQI), na.rm = TRUE)\n  ) %>%\n  ungroup()\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T06:47:06.657969Z","iopub.execute_input":"2025-05-21T06:47:06.659794Z","iopub.status.idle":"2025-05-21T06:47:09.949279Z","shell.execute_reply":"2025-05-21T06:47:09.947406Z"}},"outputs":[],"execution_count":56},{"cell_type":"code","source":"library(ggplot2)\n\nggplot(data_hki, aes(x = datetime, y = gen_AQI)) +\n  \n  # Gölgelendirme katmanları (her kategori için geom_rect)\n  annotate(\"rect\", xmin = min(data_hki$datetime), xmax = max(data_hki$datetime),\n           ymin = 0, ymax = 50, fill = \"green\", alpha = 0.07) +\n  annotate(\"rect\", xmin = min(data_hki$datetime), xmax = max(data_hki$datetime),\n           ymin = 51, ymax = 100, fill = \"yellow\", alpha = 0.07) +\n  annotate(\"rect\", xmin = min(data_hki$datetime), xmax = max(data_hki$datetime),\n           ymin = 101, ymax = 150, fill = \"orange\", alpha = 0.07) +\n  annotate(\"rect\", xmin = min(data_hki$datetime), xmax = max(data_hki$datetime),\n           ymin = 151, ymax = 200, fill = \"red\", alpha = 0.07) +\n  annotate(\"rect\", xmin = min(data_hki$datetime), xmax = max(data_hki$datetime),\n           ymin = 201, ymax = 300, fill = \"purple\", alpha = 0.07) +\n  annotate(\"rect\", xmin = min(data_hki$datetime), xmax = max(data_hki$datetime),\n           ymin = 301, ymax = 500, fill = \"maroon\", alpha = 0.07) +\n  \n  # Nokta grafiği\n  geom_point(aes(color = gen_AQI), size = 1.2, alpha = 0.8) +\n  \n  # Renk skalası\n  scale_color_gradientn(\n    colors = c(\"green\", \"yellow\", \"orange\", \"red\", \"purple\", \"maroon\"),\n    limits = c(0, 500),\n    name = \"Genel AQI\"\n  ) +\n  \n  # Eşik çizgileri\n  geom_hline(yintercept = 151, color = \"red\", linetype = \"dashed\", linewidth = 0.8) +\n  geom_hline(yintercept = 201, color = \"purple\", linetype = \"dashed\", linewidth = 0.8) +\n  \n  # Etiketler\n  labs(\n    title = \"Genel Hava Kalitesi İndeksi (gen_AQI) Zaman Serisi – Kategorilere Göre Gölgelendirme\",\n    x = \"Tarih\",\n    y = \"Genel HKİ (AQI)\"\n  ) +\n  theme_minimal()","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T06:47:12.661028Z","iopub.execute_input":"2025-05-21T06:47:12.663247Z","iopub.status.idle":"2025-05-21T06:47:15.219673Z","shell.execute_reply":"2025-05-21T06:47:15.217522Z"}},"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABaAAAAPACAIAAABM5kn/AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2DU9P/H8Xdu9drrpOy9ZSOifJmigFsRBypfEbfyRb6KijhwgFv8iqKiIg7U\nnwqIigtcCOIeDHGwQUA2lB5t73or+f1xUK7rml5L7z7wfPxFk1zyTj7JJ7kXSU4zDEMAAAAA\nAABUZol3AQAAAAAAAFVFwAEAAAAAAJRHwAEAAAAAAJRni3cBgBo+nft+QUiv2/uMfg1S4l0L\nAAAAAKAkjZeMAma0SrZvKAwOmLtxwbnN410LAAAAAKAkHlEBAAAAAADK4w4OAAAAAACgPO7g\nAAAAAAAAyjsSAw4j8O27z19+/qltG9dPddqT0zKbtT/+4mvv/PjnbfGuTFY8doKmaQM/+Lu8\nCQr3zdM0zZbUsLwJvjyjmaZpJzy24rDUV0l5Wx7SNC0l++wyx34/5d+aplntGZO+MrvlS2yf\nJXceq2naGV8f9oYzs6AnW2VVYzHhuc3bV2j+I68ek61p2lu7PTEv1Pz29Lu/b5Vsf3D53piX\nVcMMvaBtikPTNIvV8Wt+oPzpgl+/PfXaoa