\\*     | Yüksek basınçta gen\\_AQI azalıyor. Bu da önemli ve anlamlı.                 |\n","metadata":{}},{"cell_type":"markdown","source":"\n*📐 Model Performansı\n\nR² (R-kare): 0.0803 → Model, gen_AQI’deki değişkenliğin %8'ini açıklamaktadır.\n\nAdjusted R²: 0.0802 → Modelin açıklayıcılığı çok düşük ancak anlamlıdır.\n\nF-İstatistiği: 765.4, p < 0.001 → Model genel olarak anlamlıdır. \n\nYorum\n\nModel istatistiksel olarak anlamlıdır (p < 0.001).\n\nEn büyük etki rüzgar hızı üzerinden gelir (–0.465). Bu, hava sirkülasyonunun kirleticileri dağıttığını gösterir.\n\nBağıl nem ve basınç da anlamlı negatif etkiye sahiptir.\n\nSıcaklık, pozitif yönde küçük ama anlamlı bir etki göstermektedir.\n\nModelin açıklayıcılığı düşüktür (R² ≈ %8), bu da hava kalitesini etkileyen birçok başka faktörün olduğunu gösterir (trafik, sanayi, topoğrafya, inversiyon vb.).*\n","metadata":{}},{"cell_type":"markdown","source":"# # XGBoost","metadata":{}},{"cell_type":"code","source":"library(xgboost)\n\n# Gerekli değişkenler ve eksik veri temizliği\nxgb_df <- data_hki %>%\n  select(gen_AQI, temp, rhum, wspd, pres) %>%\n  filter(complete.cases(.))\n\n# Bağımlı ve bağımsız değişkenleri ayır\ny <- xgb_df$gen_AQI\nx <- xgb_df %>% select(-gen_AQI) %>% as.matrix()\n\ndtrain <- xgb.DMatrix(data = x, label = y)\n\nset.seed(42)\nxgb_model <- xgboost(\n  data = dtrain,\n  objective = \"reg:squarederror\",\n  nrounds = 100,\n  eta = 0.1,\n  max_depth = 4,\n  verbose = 0\n)\n\nimportance <- xgb.importance(model = xgb_model)\nxgb.plot.importance(importance_matrix = importance)\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-21T07:26:33.841381Z","iopub.execute_input":"2025-05-21T07:26:33.843043Z","iopub.status.idle":"2025-05-21T07:26:34.713165Z","shell.execute_reply":"2025-05-21T07:26:34.711180Z"}},"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABaAAAASwCAIAAACCY3qwAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeZyWdb3/8e89MwwMCMimIiAqKmjiFlhK27iXa